class Posts extends Component {
  componentWillMount(){
    console.log(123);
    fetch('https://jsonplaceholder.typicode.com/posts')
    .then(res => res.json())
    .then(data => console.log(data))
  }

  render() {
    return (
      <div>
        <h1>My name is Mohit</h1>
      </div>
    )
  }
}

export default Posts;
